import random

# EVOLVE-BLOCK-START
def run_search():
    n = 47
    # all grid points
    grid = [(x,y) for x in range(n) for y in range(n)]
    S = []
    random.shuffle(grid)
    for (x,y) in grid:
        # check collinearity against every pair already in S
        is_collinear = False
        for x1, y1 in S:
            if x - x1 == 0:
                slope = float('inf')
            else:
                slope = (y - y1) / (x - x1)

            for x2, y2 in S:
                if (x1, y1) == (x2, y2):
                    continue
                if x2 - x1 == 0:
                    slope2 = float('inf')
                else:
                    slope2 = (y2 - y1) / (x2 - x1)

                if x - x1 == 0 and x2 - x1 == 0:
                    if x == x1 and x == x2:
                        is_collinear = True
                        break
                elif x - x1 == 0 or x2 - x1 == 0:
                    continue
                elif abs(slope - slope2) < 1e-9:
                    is_collinear = True
                    break
            if is_collinear:
                break
        if not is_collinear:
            S.append((x,y))
    print(len(S))
    return S
